	add("orthosexuality", "{\"term\":\"orthosexuality\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|ortho|sexuality|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The orthodox or socially accepted form of sexuality or sexual expression in a particular culture\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, William Haver, \u0027The Body of This Death: Historicity and Sociality in the Time of AIDS\u0027, Stanford University Press (1996), ISBN 9780804727167, [http://books.google.com/books?id\u003dqjs7f7_raA0C\u0026amp;pg\u003dPA3\u0026amp;dq\u003d%22prefer+to+call+orthosexuality%2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"pages 2-3\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"We have erected, perhaps in place of other erections, entire structures of intelligibility and comprehensibility on and around the pandemic, structures that themselves render AIDS normative and routine: the business of AIDS, constructed and carried on around an impossible object, has become—like genocide, nuclear terror, racism, misogyny, and heteronormativity (or what I would prefer to call \u0027\u0027orthosexuality\u0027\u0027)—business as usual\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, J. Anthony Samenfink, \u0026quot;[http://articles.chicagotribune.com/1998-04-05/features/9804050187_1_sexual-behaviors-pregnancy-teens It\u0027s Time To Take A \u0027Correct\u0027 Approach To Sex Education]\u0026quot;, \u0027Chicago Tribune\u0027, 5 April 1998\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"To prevent these unintended pregnancies, it is time to take a new approach to sex education -- \u0027\u0027orthosexuality\u0027\u0027. Ortho is from the Greek meaning proper or correct, thus \u0027\u0027orthosexuality\u0027\u0027 is a method of sex education that focuses on correctly channeling the sexual drive while emphasizing the importance of preventing pregnancy, AIDS and other sexual diseases\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Barbara Molony \u0026amp; Kathleen S. Uno, \u0027Gendering Modern Japanese History\u0027, Harvard University Asia Center (2005), ISBN 9780674017801, [http://books.google.com/books?id\u003d2zwpAAAAYAAJ\u0026amp;q\u003d%22orthosexuality%22 page 193\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"from ads in \u0027naichi\u0027 (metropolitan) magazines and newspapers published inside Japan[,] in that the regulative ideal of \u0027\u0027orthosexuality\u0027\u0027 was not assumed to be reproductive, monogamous marriage. In Dalian, as everywhere in the Japanese colonies, a healthy sex life for men free from what the ad calls the \u0026quot;bad habit of masturbation\u0026quot; (\u0027akushu onani\u0027) and \u0026quot;debilitating sexual neurasthenia\u0026quot; (\u0027seiteki shinkei suijaku\u0027) would begin for most Japanese men by hygienically following the advice in the colonial newspaper\u0027s weekly column called \u0026quot;Using the Red-Light District\u0026quot; (\u0027karyūshi\", \"priority\":8}]}, \"synonyms\":{}}");

